import React from 'react'

function Proctuct(props) {
    return (
        <div>
            <svg
                width={props.width}
                height={props.height}
                id="svg">
            </svg>
            <p>Colour: {props.color}</p>
            <p>Category: {props.category}</p>
            <hr/>
        </div>
    )
}

export default Proctuct
